                    // opacity:1;"
                />
                <rect
                    x="100"
                    y="300"
                    ry="0"
                    // style="
                    // width: 100px;
                    // height: 100px;
                    // margin-left: 5%;
                    // margin-top: 20%;
                    // fill:#747A9B;
                    // stroke: white;
                    // stroke-width:2;
                    // opacity:1;"
                />
            </svg>
        </>
    );
};

export default AuthPage;
